import React from 'react'

import { AppLink } from './AppLink'
import { AppPhoneIcon } from './Icons/AppPhoneIcon'


export const AppPhone = ({ phone, ...rest }) => (
  <AppLink href={ `tel:${ phone }` } { ...rest }>
    { phone }
  </AppLink>
)
